import React, { useState } from 'react';
import axios from 'axios';
import './design/Registration.css';

function RegistrationPage() {
  const [firstname, setFirstName] = useState('');
  const [lastname, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setBirthDate] = useState('');
  const [password, setPassword] = useState('');
  const [registrationSuccess, setRegistrationSuccess] = useState(false);

  const handleRegistration = async () => {
    try {
      const userData = {
        firstname,
        lastname,
        email,
        dob,
        password
      };

      const response = await axios.post('http://localhost:9090/api/v1/customer/add', userData);
      console.log('User registered:', response.data);

    } catch (error) {
      console.error('Registration error:', error);
    }
    setRegistrationSuccess(true);
  };

  if (registrationSuccess) {
    return (
      <div className="mm-container">
        <div className="mm-background">
          <div className="mm-shape mm-shape-1"></div>
          <div className="mm-shape mm-shape-2"></div>
          <div className="mm-shape mm-shape-3"></div>
        </div>
        <div className="mm-success-card">
          <div className="mm-success-icon">
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
              <path d="M22 11.08V12a10 10 0 1 1-5.93-9.14"></path>
              <polyline points="22 4 12 14.01 9 11.01"></polyline>
            </svg>
          </div>
          <h1 className="mm-success-title">Welcome to MoodMate!</h1>
          <p className="mm-success-message">Your journal journey begins now</p>
          <a href="/" className="mm-button mm-primary-button">Continue to Login</a>
        </div>
      </div>
    );
  }

  return (
    <div className="mm-container">
      <div className="mm-background">
        <div className="mm-shape mm-shape-1"></div>
        <div className="mm-shape mm-shape-2"></div>
        <div className="mm-shape mm-shape-3"></div>
      </div>
      
      <div className="mm-card">
        <div className="mm-header">
          <h1 className="mm-logo">MoodMate</h1>
          <p className="mm-tagline">Your personal emotional journal</p>
        </div>
        
        <h2 className="mm-form-title">Create Account</h2>
        
        <div className="mm-form">
          <div className="mm-input-row">
            <div className="mm-input-group">
              <label className="mm-label">First Name</label>
              <input 
                type="text" 
                className="mm-input" 
                value={firstname} 
                onChange={(e) => setFirstName(e.target.value)} 
                placeholder="Enter your first name" 
              />
            </div>
            <div className="mm-input-group">
              <label className="mm-label">Last Name</label>
              <input 
                type="text" 
                className="mm-input" 
                value={lastname} 
                onChange={(e) => setLastName(e.target.value)} 
                placeholder="Enter your last name" 
              />
            </div>
          </div>
          
          <div className="mm-input-group">
            <label className="mm-label">Email Address</label>
            <input 
              type="email" 
              className="mm-input" 
              value={email} 
              onChange={(e) => setEmail(e.target.value)} 
              placeholder="your.email@example.com" 
            />
          </div>
          
          <div className="mm-input-group">
            <label className="mm-label">Password</label>
            <input 
              type="password" 
              className="mm-input" 
              value={password} 
              onChange={(e) => setPassword(e.target.value)} 
              placeholder="Create a secure password" 
            />
          </div>
          
          <div className="mm-input-group">
            <label className="mm-label">Date of Birth</label>
            <input 
              type="date" 
              className="mm-input" 
              value={dob} 
              onChange={(e) => setBirthDate(e.target.value)} 
            />
          </div>
          
          <button className="mm-button mm-primary-button" onClick={handleRegistration}>
            Create Account
          </button>
          
          <p className="mm-login-redirect">
            Already have an account? <a href="/" className="mm-link">Sign in</a>
          </p>
        </div>
      </div>
    </div>
  );
}

export default RegistrationPage;
